Movie Info: Kunjananthante Kada is a 2013 Malayalam drama film written and directed by Salim Ahamed. The film stars Mammootty in the titular role, as a shopkeeper, alongside debutante actress Nyla Usha while Salim Kumar and Balachandra Menon play other pivotal roles. The story is about a small-time shopkeeper in Kannur and his attempt to find his own place in a rapidly changing world.

The film features music composed by M. Jayachandran, cinematography by Madhu Ambat, and sound editing by Resul Pookutty. This was the first film in Malayalam in which Resul is doing synchronized sound recording or sync sound. The film's shooting commenced in February 2013. It released on August 30, 2013.


